import React from 'react';
import '../App.css';
import logo from '../logo.svg';

function Nav() {
  return (
    <div className="nav">
      <nav>
        <h3><img src={logo} className="nav-logo" alt="logo" /></h3>
        <ul>
            <li>About</li>
            <li>Events</li>
        </ul>
      </nav>
    </div>
  );
}

export default Nav;
